"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["6740"],{18197:function(t){t.exports=JSON.parse('{"name":"Bluesky Post","url":"https://codeberg.org/woodpecker-plugins/bluesky-post","icon":"https://codeberg.org/woodpecker-plugins/bluesky-post/raw/branch/main/bluesky.svg","description":"Post statuses to Bluesky.","docs":"<h1>Bluesky Post plugin</h1>\\n<p>Woodpecker plugin to post statuses to Bluesky.</p>\\n<blockquote>\\n<p>\u26A0\uFE0F Media attachments and facets (links, mentions) are not supported yet.</p>\\n</blockquote>\\n<h2>Usage</h2>\\n<pre><code class=\\"language-yaml\\">image: woodpeckerci/plugin-bluesky-post\\nsettings:\\n  identifier: woodpecker-ci.org\\n  app_password:\\n    from_secret: bluesky_app_password\\n  text: We just released {{ CI_COMMIT_TAG }} \uD83D\uDE80\\n</code></pre>\\n<h3>Settings</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Setting</th>\\n<th>Description</th>\\n<th>Required?</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>service_url</code></td>\\n<td>Bluesky service url, including protocol.</td>\\n<td>No</td>\\n<td><a href=\\"https://bsky.social\\">https://bsky.social</a></td>\\n</tr>\\n<tr>\\n<td><code>identifier</code></td>\\n<td>Your Bluesky handle (without @) or did</td>\\n<td>Yes</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>app_password</code></td>\\n<td>Your Bluesky app password</td>\\n<td>(<a href=\\"#get-app-password\\">How to get an app password</a>)</td>\\n<td>Yes</td>\\n</tr>\\n<tr>\\n<td><code>text</code></td>\\n<td>Text to post (Allows <a href=\\"#templating\\">Templating</a>)</td>\\n<td>Yes (if <code>ai_token</code> is not set)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>media</code></td>\\n<td><code>,</code>-separated list of paths to attachments</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>in_reply_to_root</code></td>\\n<td>Root ID of post to reply to</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>in_reply_to_parent</code></td>\\n<td>Parent ID of post to reply to</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>languages</code></td>\\n<td><code>,</code>-separated list of post languages</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><code>,</code>-separated list of post tags</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>labels</code></td>\\n<td><code>,</code>-separated list of post labels</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>ai_token</code></td>\\n<td>Provide an AI token (OpenAI) to generate a post text</td>\\n<td>Yes (if <code>text</code> is not set)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>ai_model</code></td>\\n<td>Select the model used to generate a post text</td>\\n<td>No</td>\\n<td><code>gpt-4o-mini</code></td>\\n</tr>\\n<tr>\\n<td><code>ai_prompt</code></td>\\n<td>Prompt used to generate a post text. (Allows <a href=\\"#templating\\">Templating</a>)</td>\\n<td>No</td>\\n<td><a href=\\"https://codeberg.org/woodpecker-plugins/mastodon-post/src/commit/e40ca562e9e84de40ad4f148ec617f45ed583b11/src/index.ts#L37-L42\\">prompt</a></td>\\n</tr>\\n<tr>\\n<td><code>changelog_file</code></td>\\n<td>File to use for the AI to make a changelog from.</td>\\n<td>No</td>\\n<td><code>CHANGELOG.md</code></td>\\n</tr>\\n</tbody></table>\\n<h3>Get app password</h3>\\n<p>In order to get an app password, go to <a href=\\"https://bsky.app/settings/app-passwords\\">https://bsky.app/settings/app-passwords</a> and create a new app password.</p>\\n<h3>Templating</h3>\\n<p>You can use <code>{{ CI_COMMIT_TAG }}</code> and other environment variables in the <code>status</code> or <code>ai_prompt</code> settings.\\nThe <code>ai_prompt</code> template can also use <code>{{ CHANGELOG }}</code> to include the changelog of the release.</p>\\n","tags":["post","status","bluesky"],"containerImage":"woodpeckerci/plugin-bluesky-post","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-bluesky-post","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"}')}}]);